function devolver_correcto(){
    $().colorbox.close();
    recargar();
    Modal.success("Se ingreso la devolucin correctamente");
}

function firma_correcta(parametros){
    $().colorbox.close();
    recargar();
    
    Modal.success("El documento se firm correctamente", function(){
        Modal.closeAll();
        for(var i = 0; i < parametros.length; i++){
            $.ajax({
                url : Base.getBaseUri() + 'BandejaTrabajo/Firmador/postFirma',
                data : {expediente_detalle :  parametros[i]},
                type : 'post',
                dataType : 'json',
                async : false,
                cache : false,
                success : function(response){
                    if(response.correcto == true){
                        console.log("Notificacion enviada");
                    }

                }
            });
        }

        
        recargar();
    	
    });
}

