function fillCertificatesExtension(data){
    if(data.detail){
        data = eval(data.detail);
        //console.log("*** LISTA DE CERTIFICADOS ***");document.getElementById('console').innerHTML+="*** LISTA DE CERTIFICADOS ***\n";
        for(i in data){
            $('#mySelect').append($('<option>', {
                value: "1",
                text: data[i].alias
            }));
        }
    }
}

function signFEAExtension(parametros, boton){
    btn = boton;
    var optSelected = $("#mySelect option:selected").text();

    console.log("*** CERTIFICADO SELECCIONADO ***");
    //document.getElementById('console').innerHTML+="*** CERTIFICADO SELECCIONADO ***\n";
    console.log(optSelected);
    //document.getElementById('console').innerHTML+=optSelected+"\n";

    var xml = xml_pdf.replace("__ALIAS_CERT__",optSelected);
    console.log("*** COMIENZA A FIRMAR ***");
    //document.getElementById('console').innerHTML+="*** START SIGN! ***\n";

    var ev=document.createEvent("CustomEvent");
    
    console.log("*** URL Get ***");
    console.log(url_get + "/" + parametros);
    
    console.log("*** URL Put ***");
    console.log(url_post + "/" + parametros);
    
    ev.initCustomEvent("signFeaExtension",true,true,{xml:xml,urlGet:url_get + "/" + parametros,urlPost:url_post + "/" + parametros,user:"test",pass:"test"});
    params = parametros.split("/");
    console.log(params);
    expedientes_detalle.push(params[1]);
    console.log(ev);
    var r =document.dispatchEvent(ev);
    console.log(r);
}

document.addEventListener("fillCertificatesExtension",fillCertificatesExtension,false);

document.addEventListener("respSignFeaExtension",function(data){	
    var resultado = "";
    if(data.detail.result){		
            resultado = " Firmado: "+data.detail.hash+"\n";					
            firma_correcta(expedientes_detalle);
    }else{		
            resultado = " Error: "+data.detail.hash ;		
            //iframe[0].Modal.error("Error al firmar");	
            firma_incorrecta();	
            	
    }
        console.log(resultado);

},true);

